 import product_cart from "../data/product_data";
import './mainproduct.css';
import * as React from 'react';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import './mainproduct.css';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

const listItem=product_cart.map((item)=>

<Box className="cart">
<value src={item.thumb} alt="Logo" style={{ height: '40%',width:'25%', margin: '10px', flexGrow: 2 }} />
<div className="h3">
<h3>{item.name}</h3>
</div>
<div className="description">
<p>{item.description}</p>
</div>
<p className="price">{item.real_price}</p>
</Box>
 );


const Mainproduct = () => {
  const [spacing, setSpacing] = React.useState(2);
  
    const handleChange = (event) => {
      setSpacing(Number(event.target.value));
    };
  
    const jsx = `
  <Grid container spacing={${spacing}}>
  `;
  
  

  return(
      <Grid sx={{ flexGrow: 1 ,backgroundColor:"red"}} container spacing={2}>
        <Grid item xs={17} sx={{backgroundColor:"blue"}}>
          <Grid container justifyContent="center" spacing={spacing}>
            {listItem.map((value) => (
              
              <Grid>
                {console.log(value)}
                      <Card sx={{ maxWidth: 345 }}>
                          <CardActionArea>
                            <CardMedia
                              component="img"
                              height="140"
                              image={value.img}
                              alt="green iguana"
                            />
                            

                            <CardContent>
                              <Typography gutterBottom variant="h5" component="div">
                                {listItem.name}
                              </Typography>
                              <Typography variant="body2" color="text.secondary">
                              {listItem.description}

                              </Typography>
                            </CardContent>
                          </CardActionArea>
                        </Card>
                
              </Grid>
              
            ))}
            
          </Grid>
        </Grid>
        
      </Grid>);
    








              


}
export default Mainproduct;
